webpackJsonp([0xc14d9b122ee4],{4830:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Thursday",date:"02 Mar 2000",slug:"/2000-03-02-thursday/",tags:"Y2000"},html:'<p>Yahoo! Deutschland <a href="http://de.news.yahoo.com/000302/9/m23f.html">Elbtunnelbohrer «Trude» ist zurück aus der Tiefe</a> "Trude" is the largest drill bit in the world (14.2 m diameter, 2000 metric tons), digging a 4th tube for the congested Elbe Autobahn tunnel under Hamburg\'s harbor. Today, after nearly 2 miles and 2-1/2 years, it reached the surface on the north side of the Elbe. However, the tube will not pen for traffic for another 2 years. <i>«Trude» is a girl\'s name, but in this case stands for «tief runter unter die Elbe»  -  deep down under the Elbe.</i></p>\n<p>Pictures of Moritz waking up at Familie Berg <a href="http://familieberg.editthispage.com/2000/03/02">Aus tiefen Träumen</a></p>\n<p>Dave Polaschek <a href="http://www.polaschek-computing.com/misc/movingmn.html">Moving to MN</a>: "This is culled from an email I sent to someone interested in moving to Minnesota. He was particularly interested in Rochester and Bemidji, so I covered those parts of the state a little more thoroughly than others." <i>(via <a href="http://brdbrain.editthispage.com">brdbrain</a>)</i></p>\n<p>netdyslexia <a href="http://netdyslexia.editthispage.com/surveys/run/arf@sexyjazz.de/doYouWantToSeeTheOriginalHorse">Do you want to see the original horse?</a> <i>Can\'t we choose both a and c? ";->"</i></p>\n<p>Slashdot  <a href="http://slashdot.org/article.pl?sid=00/03/01/092251&mode=thread"> Free Internet Access for Hamburgers</a>:  The city of Hamburg has announced "that all of its citizens will receive free Internet access... Citizens will pay no direct provider costs, only telephone costs." <i>Full telephone costs? Since Germans still pay for each local call, AOL would be a better deal for most people...</i></p>'},next:{fields:{title:"CeBIT Last Day",date:"01 Mar 2000",slug:"/2000-03-01-cebit-last-day/"}},previous:{fields:{title:"Friday",date:"03 Mar 2000",slug:"/2000-03-03-friday/"}}},{node:{fields:{title:"CeBIT Last Day",date:"01 Mar 2000",slug:"/2000-03-01-cebit-last-day/",tags:"Y2000"},html:"<p>I don't know why I keep mentioning the CeBIT... I wasn't actually there at all this year.</p>"},next:{fields:{title:"CeBIT Tuesday",date:"29 Feb 2000",slug:"/2000-02-29-cebit-tuesday/"}},previous:{fields:{title:"Thursday",date:"02 Mar 2000",slug:"/2000-03-02-thursday/"}}},{node:{fields:{title:"CeBIT Tuesday",date:"29 Feb 2000",slug:"/2000-02-29-cebit-tuesday/",tags:"Y2000"},html:'<p>Mama and Christopher are visiting Oma (Grandma) Ruth in Eckernförde for the rest of the week. It\'s Christopher\'s first road trip. (But don\'t expect any updates on her home page for the next few days... I doubt if she has time to stop by the Internet café.)</p>\n<p>This was the top news story in Germnay today. MS<a href="http://www.msnbc.com/news/375933.asp">Germans hold U.S. teens over deaths</a>:  "Prosecutors asked for murder charges Tuesday against three U.S. teenagers accused of tossing rocks from a highway bridge at passing cars, killing two drivers"</p>\n<p>The media here is not making a big deal that the teenagers are American. There have been a dozen similar incidents in the past 10 years involving German youth causing injury or death to drivers by throwing objects from bridges.</p>\n<p>I was going to write something about Amazon\'s patent last night, but instead I told <a href="http://andrea.editthispage.com/discuss/msgReader$113">Andrea</a> about how at the beginning of our relationship Mama and I stayed in touch from separate contintents, before there was an Internet, or even cheap international phone calls. (Actually, I just wanted her to tell her story of how she and André <a href="http://andrea.editthispage.com/stories/storyReader$117">met via the Internet</a>.) </p>\n<p>I\'ve been fiddling with my ISDN connection at home, trying to get it to work with FreeBSD, so I\'ve been mostly offline the past couple of days. I did give Mama my spare ISDN card, though, so she could stay online.</p>'},next:{fields:{title:"CeBIT Saturday",date:"26 Feb 2000",slug:"/2000-02-26-cebit-saturday/"}},previous:{fields:{title:"CeBIT Last Day",date:"01 Mar 2000",slug:"/2000-03-01-cebit-last-day/"}}}],pathPrefix:"",first:!1,last:!1,index:1075,pageCount:1101}}}});
